import React from 'react';


function Pdf(){

    return (
        <div id="content" style={{position:'absolute',width:'100%',height:'100%'}} align="center">
            <img src="login.png" style={{width:'50px',height:'50px'}} alt=""/>
        </div>
    );

}

export default Pdf;
